webpackJsonp([0xce2e3b928d3b],{1579:function(a,o){a.exports={data:{markdownRemark:{html:'<p>새로운 Jinjiang에서 일본 손님들을 만나십시오. 그는 일본은 이제 중국 경제가 자유화되고 정치 민주화가 어떻게 진행될 것인가에 대해 가장 우려하고 있다고 언급했다. 저는 민주주의 과정에서 중국 문제가 일본에 영향을 줄 것을 두려워합니다. 이 문제에 대해 이야기하는 서방 국가의 일부 사람들과 달리, 그들은 중국에 압력을 가하고 있습니다.</p>\n<p>그는 중국에 와서 거리를 걸어 가면서 중국 사람들의 쾌활한 얼굴과 번영을 보았고 때마다 그들은 크게 변화했다. 일본 경제는 현재 현실적으로 어려움을 겪고 있습니다. 일본은 실제로 "사회주의 국가"입니다. 행정 부서는 많은 문제를 관리했으며, 역의 이동에도 중앙 관할 당국의 승인이 필요합니다. 현재 일본의 정치 지도자 인 호소카와 (Hosokawa)와 오자와 (Ozawa). 이번에는 오자와 (Ozawa)와 호소카와 (Hosokawa)가 정치 체제의 개혁과 조세 체계의 개혁에 관한 토론을 실제로 지시했다. 많은 사람들이이 견해를 가지고 있습니다. 사회당은 소비 세에 대해 다른 견해를 갖고 있으며, 분열을 초래하지 않을 것이며 또한 조정할 수 있다고 믿는다. 열악한 경제 발전의 경우 세금 개혁이 잘 이루어져야합니다. 그 후 경제 발전의 모멘텀이 향상되고 세금이 추가 될 것입니다. 현재의 조정은이 전략에서 비롯됩니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0026.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0026.md",frontmatter:{title:"2월 6일 일요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0026.md absPath of file >>> MarkdownRemark"}}}});
